    false,nt"url": null,nt"notes": "NCEI Accession 0155955 contains raw underway
    meteorological, navigational, optical, physical, profile and time series data logged
    by the Scientific Computer System (SCS) aboard NOAA Ship Oregon II in the Gulf of
    Mexico from 2016-06-07 to 2016-06-20. Office of Marine and Aviation Operations (OMAO)
    personnel aboard the ship submitted these data and associated metadata to NCEI.
    In addition, NCEI Accession 0155955 contains supplementary cruise-level metadata,
    which OMAO personnel logged in the Ship Daily Activity Log (SDAL). OMAO and NCEI
    personnel developed the automated process to archive these data under the auspices
    of the NOAA Rolling Deck to Repository (NOAA R2R) program.",nt"owner_org":
